('2214','7','9180','Grundstück ZIns Solar 45 Manzana T',Null,'Baugrundstück in beliebter Villenwohnlage in Nova Santa Ponsa','31397','Das Baugrundstück liegt in einer der beliebtesten Villen – Wohnlagen im Südwesten von Mallorca. Nur wenige  Fahrminuten entfernt erreicht man die Jachthäfen von Port Adriano und Santa Ponsa, sowie 4 Golfplätze, Restaurants und Supermärkte.\r\nDas flache Grundstück ist leicht zu bebauen und hat 1.380m². Vom 1.OG hat man noch einen sehr schönen Meerblick. Die Bebaubarkeit liegt bei 35% und die Belegung bei 45%. Erlaubt ist der Baus einer Einfamilienvilla mit max 2 Etagen plus Keller (Tiefgarage) und mit einer max Gebäudehöhe von 8,5m. Weitere Infos erhalten Sie bei Anfrage. Deutschsprachige Architekten und Bauunternehmer können wir gerne vermitteln.\r\n','31398','695000','106','2014-05-14 14:00:19','110','2014-05-14 14:00:49',Null,'2174','121','818',1,'1','0',Null,Null,Null,'31399',Null,'0','0','0',Null,'2015-04-20 15:47:49',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'31400',Null,'31401',Null,'31402',Null,'31403',Null,'31404','0',0,'0');
